import React, { Component } from "react";
import Form from "../components/Form";

const BookList = props => {
  return (
    <div className="book-list">
      <h1>
        Book List
        <div>
          {props.books.map(book => {
            <Book book={book.book} />;
          })}
        </div>
      </h1>
      <Form />
      <ul>{/*render list of books here*/}</ul>
    </div>
  );
};

export default BookList;
